passage.text:
Art. 4o Para efeitos desta Lei considera-se: 
I  carreira: conjunto de cargos distribuidos de acordo com a sua responsabilidade e a sua 
complexidade;
II  cargo: conjunto de atribuicoes e de responsabilidades previstas na estrutura organizacional 
que devem ser cometidas ao servidor;
III  especialidade: area de competencia correspondente as atribuicoes especificas 
desempenhadas pelo servidor;
IV  qualificacao profissional: aprimoramento do servidor com vistas a formacao continuada e 
ao desenvolvimento no cargo;
V  habilitacao: formacao do servidor em razao do grau de escolaridade e qualificacao 
profissional;
VI  progressao: passagem do padrao em que se encontra o servidor para os subsequentes, 
dentro da mesma classe, considerando-se o tempo de servico no cargo ocupado;
VII  classe/padrao: posicao do servidor na tabela de escalonamento vertical; 
VIII  vencimento basico: percepcao pecuniaria equivalente ao padrao do cargo ocupado pelo 
servidor, observada a jornada de trabalho; 
IX  remuneracao: valor mensal recebido pelo servidor, conforme a Lei Complementar no 840, 
de 23 de dezembro de 2011; 
X  mobilidade: deslocamento do servidor para o Quadro de Lotacao de Pessoal entre orgaos 
do Governo do Distrito Federal.
